import React, { Component } from "react";


class Settings extends Component {

    state = {
        show: false
      };
      showModal = e => {
        this.setState({
          show: true
        });
      };
    
    render() {
      return (
        <button onClick={e => {this.showModal();}}> 
                show Modal 
        </button>
      )

    }
  }

export default Settings;
